 import {useState, useEffect} from 'react'
 import SearchBar from './SearchBar';

 function App() {
  const [products, setProducts] = useState([])
  useEffect(() => {
    setTimeout(() => {
      setProducts = [
       'tooth paste',
       'tooth brush',
       'mouth wash',
       'mouth guard'
   ]
    }, 3000)

  }, [])

  return (
    <div className="todo-pp" >
      <SearchBar products={products} />


    </div>
  );
}

export default App;
